      <form className="auth__form">

        <input
          className='auth__input'
          value={''}
          placeholder="Email"
          type="email"
          name="email"
        />


        <input
          className='auth__input'
          value={''}
          placeholder="Пароль"
          type="password"
          name="password"
        />


        <button className='auth__submit-button' type="submit">Войти</button>
      </form>
    </div>
  );
}

export default Login;
